import React from 'react';

export default function index(){
    fetch('https://jsonplaceholder.typicode.com/posts', {method: 'get', headers: {'Content-Type':'application/json'}}).then((res)=>  res.json()).then(data => {console.log("data===========>", data);})
    return(
        <>
            <h1 style={{textAlign: 'center'}}>POSTS INDEX</h1>
        </>
    )
}
